import React from "react"

const BountyForm = (props) => {
    const { handleSubmit, handleChange, btnText, firstName, lastName, side, living } = props
    return(
        <form onSubmit={handleSubmit}>
            <input 
                type="text"
                name="firstName"
                value={firstName}
                onChange={handleChange}
                placeholder="First Name"/>
            <input 
                type="text"
                name="lastName"
                value={lastName}
                onChange={handleChange}
                placeholder="Last Name"/>
            <span> Check if living: </span>
            <input 
                type="checkbox"
                name="living"
                checked={living}
                onChange={handleChange}
                placeholder="First Name"/>
            <label>Sith: </label>
            <input 
                type="radio"
                value="Sith"
                onChange={handleChange}
                checked={side === "Sith"}/>
            <label>Jedi: </label>
            <input 
                type="radio"
                value="Jedi"
                onChange={handleChange}
                checked={side === "Jedi"}/>
            <button>{btnText}</button>
        </form>
    )
}

export default BountyForm;
